/*
542. 01 矩阵
https://leetcode.cn/problems/01-matrix/description/

给定一个由 0 和 1 组成的矩阵 mat ，请输出一个大小相同的矩阵，其中每一个格子是 mat 中对应位置元素到最近的 0 的距离。
两个相邻元素间的距离为 1 。

方法：广度优先遍历。
1. 收集矩阵中所有0的位置作为起点集合s.
2. 对s中的每一个元素做一次广度优先遍历。
3. 对于步骤2中的每一个0做广度优先遍历的时候，如果当前被访问的节点是1，如果当前step < 距离 那么更新目标距离
4. 什么是相邻？这里应该是一个点（上、下、左、右）为相邻。
5. 一个直观的想法是运行多次bfs算法，也就是对每一个起点都运行一次bfs，但其实可以引入一个超级顶点。
 它架设在所有的顶点0的前端，从它开始运行一次bfs。

超级节点的思想和之前做长亭科技的笔试题：申请经费有点像。那个问题通过引入一个超级节点，解决如何在图中表示自建费用的难点。
*/

func updateMatrix(mat [][]int) [][]int {
	row, col := len(mat), len(mat[0])
	dist := make([][]int, row)
	for i := 0; i < row; i++ {
		dist[i] = make([]int, col)
		for j := 0; j < col; j++ {
			dist[i][j] = math.MaxInt
		}
	}

	// 收集起点
	starts := make([][]int, 0)
	for i := 0; i < row; i++ {
		for j := 0; j < col; j++ {
			if mat[i][j] == 0 {
				starts = append(starts, []int{i, j})
			}
		}
	}

	dx := []int{-1, 1, 0, 0}
	dy := []int{0, 0, -1, 1}
	var bfs func(start [][]int)
	bfs = func(starts [][]int) {
		visited := make([][]bool, row)
		for i := 0; i < row; i++ {
			visited[i] = make([]bool, col)
		}

		queue := list.New()
		for _, s := range starts {
			queue.PushBack(s)
			visited[s[0]][s[1]] = true
		}
		step := 0
		for queue.Len() != 0 {
			queCnt := queue.Len()
			for i := 0; i < queCnt; i++ {
				cur := queue.Remove(queue.Front()).([]int)
				if mat[cur[0]][cur[1]] == 0 {
					dist[cur[0]][cur[1]] = 0
				} else {
					dist[cur[0]][cur[1]] = step
				}

				for j := 0; j < 4; j++ {
					nextX := cur[0] + dx[j]
					nextY := cur[1] + dy[j]
					if nextX >= 0 && nextY >= 0 && nextX < row && nextY < col && !visited[nextX][nextY] {
						queue.PushBack([]int{nextX, nextY})
						visited[nextX][nextY] = true
					}
				}
			}
			step++
		}
	}

	bfs(starts)
	return dist
}

func updateMatrix0(mat [][]int) [][]int {
	row, col := len(mat), len(mat[0])
	dist := make([][]int, row)
	for i := 0; i < row; i++ {
		dist[i] = make([]int, col)
		for j := 0; j < col; j++ {
			dist[i][j] = math.MaxInt
		}
	}

	// 收集起点
	starts := make([][]int, 0)
	for i := 0; i < row; i++ {
		for j := 0; j < col; j++ {
			if mat[i][j] == 0 {
				starts = append(starts, []int{i, j})
			}
		}
	}

	// 广度优先遍历 更新矩阵中每一个点距离起点的距离。（如果是0，则直接置0）
	dx := []int{-1, 1, 0, 0}
	dy := []int{0, 0, -1, 1}
	var bfs func(start []int)
	bfs = func(start []int) {
		visited := make([][]bool, row)
		for i := 0; i < row; i++ {
			visited[i] = make([]bool, col)
		}
		queue := list.New()
		queue.PushBack(start)
		visited[start[0]][start[1]] = true
		step := 0
		for queue.Len() != 0 {
			queCnt := queue.Len()
			for i := 0; i < queCnt; i++ {
				cur := queue.Remove(queue.Front()).([]int)
				if mat[cur[0]][cur[1]] == 0 {
					dist[cur[0]][cur[1]] = 0
				} else {
					dist[cur[0]][cur[1]] = min(dist[cur[0]][cur[1]], step)
				}

				for j := 0; j < 4; j++ {
					nextX := cur[0] + dx[j]
					nextY := cur[1] + dy[j]
					if nextX >= 0 && nextY >= 0 && nextX < row && nextY < col && !visited[nextX][nextY] {
						queue.PushBack([]int{nextX, nextY})
						visited[nextX][nextY] = true
					}
				}
			}
			step++
		}
	}

	for _, s := range starts {
		bfs(s)
	}
	return dist
}

func min(args ...int) int {
	m := args[0]
	for i := 1; i < len(args); i++ {
		if m > args[i] {
			m = args[i]
		}
	}
	return m
}

